import React from "react"
import styled from "styled-components"

const Wrapper = styled.div`
form{
    height: 40%;
    width: 80%
}

input{
    width: 2
}
`

const AdminForm =  (props) => {
    const {
        handleChange,
        handleSubmit,
        btnText,
        errMsg,
        inputs: {
            username, password
        }
    } = props

    return (
      <Wrapper>
        <form onSubmit={handleSubmit}>
          <input
            type="text"
            value={username}
            name="username"
            onChange={handleChange}
          />
          <input
            type="password"
            value={password}
            name="password"
            onChange={handleChange}
          />
          <button>{btnText}</button>
          <p>{errMsg}</p>
        </form>
      </Wrapper>
    );
}

export default AdminForm
